Я не добавляю в друзья: 
- Фейков; 
- Ботанов;
- Нубов; 
- Мобов; 
- Спамеров;
- Ламеров; 
- Педиков; 
- Проституток; 
- Идиотов; 
- Наркоманов; 
- И других наглых животных, обитающих vkontakte. Если ты не подходишь ни под один из этих пунктов, то добро пожаловать ко мне в друзья. Буду рада новым знакомствам! ;)
